    <script type="text/javascript">
        function plot(eq) {
            window.eq = 'y = ' + eq.toLowerCase();
            eq = eq.toLowerCase()
                .replace(/ /g, '')
                .replace(/sin/g, 'Math.sin')
                .replace(/cos/g, 'Math.cos')
                .replace(/sqrt/g, 'Math.sqrt')
                .replace(/tan/g, 'Math.tan')
                .replace(/y/g, 'z');
            var index = -1;
            var left, right, rightS, rightE;
            while((index = eq.indexOf('^')) != -1) {
                eq = eq.replace('^', ',');
                left = eq.substring(0, index - 1);
                right = eq.substring(index - 1);
                left = left + 'Math.pow(';
                rightS = right.substring(0, 3);
                rightE = right.substring(3);
                right = rightS + ')' + rightE;
                eq = left + right;
            }
            window.parsedEq = eq;
            window.eqEval = function(x, z) {
                return eval(window.parsedEq);
            };
            //Android.check(window.parsedEq + '|' + window.eq);
            initSurfaceChart();
          }

          function initSurfaceChart() {
            var chartConfig={
                title: 'Surface Chart',
                subtitle: window.eq.toString(),
                plot: {
                  xAxis: { label: 'X', range: [-2, 2] },
                  yAxis: { label: 'Y', range: [-2, 2] },
                  zAxis: { label: 'Z', range: [-2, 2] }
                },
                renderer: {
                  xSamples: 20, zSamples: 20,
                  colorScale: { type: 'rainbow', range: [-1, 1] }
                },
                style: 'Orson 2'
            };
            configureOrsonSurfaceChart3D('#canvas', chartConfig, eqEval);
          }
